export const obtenerAsuntos = async() => {
    const response = await fetch("https://nelsontarche.com.ar/api/obtenerAsuntos.php");
    const data = await response.json();
    return data;
}


export const guardarFormulario = async () => {
    const response = await fetch("https://nelsontarche.com.ar/api/guardarFormulario.php");
    const data = await response.json();
    return data;
}
